package net.sharplab.springframework.security.fido.metadata;

import com.nimbusds.jwt.JWTParser;
import com.nimbusds.jwt.SignedJWT;
import org.junit.Before;
import org.junit.Test;
import org.springframework.core.io.DefaultResourceLoader;
import org.springframework.core.io.ResourceLoader;

import java.text.ParseException;

/**
 * Test for CertPathJWSVerifier
 */
public class CertPathJWSVerifierTest {

    private CertPathJWSVerifier target;

    @Before
    public void setup(){
        ResourceLoader resourceLoader = new DefaultResourceLoader();
        target = new CertPathJWSVerifier(resourceLoader);
    }

    @Test
    public void test() throws ParseException {
        String token = "..DL0cHehH2oPG7LWPkSZN3y4FnOzJ5_RqClwSMSiPHscZysp1KgTrlPRkudltcAIwcq7wWARLiemCguHcNVZuNA";
        SignedJWT jwt = (SignedJWT) JWTParser.parse(token);
        target.verify(jwt);
    }
}
